import React,{useEffect,useState} from 'react'
import{useParams} from 'react-router-dom'
import axios from 'axios';
const Apidetail = () => {
    const param=useParams();
    const [apis,setapis]=useState([]);
    const [usname,setusname]=useState();
    const [islog, setislog] = useState(false);
    const [iskey, setiskey] = useState(false);
    const [keydata,setkeydata]=useState();
    useEffect(()=>{
        if (sessionStorage.getItem("users") != null) {
            const loguser=sessionStorage.getItem("users");
            const username=JSON.parse(loguser);
            setusname(username.uname);
            setislog(true)
          }
          axios.post(process.env.REACT_APP_BACKEND+"/getKe",{usname}).then((res)=>{
              setkeydata(res.data.Key);
              console.log(res.data.Key)
              setiskey(true);
          })
        const url=process.env.REACT_APP_BACKEND+"/getapi"
        axios.get(url).then((res)=>{
          setapis(res.data)
     }).catch((err)=>{
          console.log(err);
     })
    },[islog,keydata])
    return (
        <>
        {
            apis.map((data)=>{
               if(data.Name===param.name)
               {
                   return(
                   <div key={data._id}>
                    <div className='apihead container-fluid m-2 p-2'>
                    <div className='subapihead'>
                        <div>
                            <img src={`${process.env.REACT_APP_BACKEND}/getApis/${data.Image}`}alt='not get' className='apidetimg'></img>
                        </div>
                        <div className='text-center ms-3'>
                            <h4>{param.name}</h4>
                        </div>
                    </div>
                    <div className='apistatus'>
                        <div>f</div>
                        <div>f</div>
                        <div>f</div>
                    </div>
                </div>

            <div className='mt-4 container-fluid m-2 p-2'><p>{data.Description}</p></div>
            </div>
            )
        }
        else{
            return(
                <div  key={data._id}></div>
            )
        }
     })
 }
